  true,\n\t\"url\": null,\n\t\"notes\": \"The Healthy, Hunger-Free Kids Act of 2010
  (HHFKA) directed the Department of Agriculture (USDA) to establish nutrition standards
  for all foods and beverages sold to students on the school campus during the school
  day.  On June 28, 2013, the Food and Nutrition Service (FNS) published the \"Smart
  Snacks in School\" (Smart Snacks) regulation that carefully balances science-based
  nutrition standards with practical and flexible solutions to promote healthier eating
  on campus.  The purpose of this memorandum is to clarify Smart Snacks standards
  for exempt food that are paired together as a single snack.\",\n\t\"license_title\":
